import React from 'react';
import header from '../images/artheader.jpg'

class Home extends React.Component {
    render(){
        return <div className="main-content">
                <img classname="header" src={header} alt="Oops."/>
                    This is home page
                </div>
            ;
    }
}

export default Home;
